import React from 'react';

export default function BtnIcnLeft({children}) {

    return(
        <>
        <button type="button" class="m-3 bg-secondary text-white py-2 px-4 rounded-full font-bold text-lg">
            <i class="fa-solid fa-phone"></i>
            {children}
        </button>
        </>
    );
};
